    false,nt"url": null,nt"notes": "This dataset consists of CRAMP Rapid Assessment
    Transect surveys taken in 2006 and includes quantitative estimates of substrate
    type and species. In 2006, there were 8 sites surveyed on Maui. Surveys typically
    consist of shallow (~3m) and deep (~10m) lines. The types and coverages were derived
    objectively from photographic images using PhotoGrid, a software package which analyzes
    random points on images of coral reefs and substrate. This dataset does not include
    the images from the transects, which have been provided to NOAA separately.",nt"license_title":
